+ (UIImage*)imageOfBinocularsIconWithFrame: (CGRect)frame
{
    UIGraphicsBeginImageContextWithOptions(CGSizeMake(30, 30), NO, 0.0f);
    [SebastiaanStyleKit drawBinocularsIconWithFrame: frame];

